import React, { Component } from 'react';
import Footer from "./../components/Footer";
import Header from "./../components/Header";
class DetailProduct extends Component {
    render() {
        return (
            <div>
                <Header />
                <section>
                    <div className="container">
                        <div class="row">
                            <div className='col-xl-6'>
                                <div className="video-left1">
                                    {/* <img src="https://xwatch.vn/images/videos/resized/aa2_1562241809.jpg"/> */}

                                    <video width="400" controls>
                                        <source src="video-oclock.mp4" type="video/mp4"/>
                                    </video>

                                    <div className='icon-youtube'>
                                        <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e1/YouTube_play_buttom_icon_%282013-2017%29.svg/1024px-YouTube_play_buttom_icon_%282013-2017%29.svg.png" />
                                    </div>
                                    <div className='title-video'>
                                        <span>XWATCH VIDEO:</span>
                                        <h1>VTV1:TIÊU HỦY ĐỒNG HỒ GIẢ CÙNG XWATCH</h1>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
                <Footer />
            </div>
        )
    }
}
export default DetailProduct;
